import React from "react";
import "./Formula.css";

function Formula() {
  return (
    <div className="formula-page">
      <table>
        <thead>
          <tr>
            <th>NAME</th>
            <th>COST_CODE</th>
            <th>EDITABLE</th>
            <th>ITEM_ID</th>
          </tr>
        </thead>
        <tbody>{/* Map over your data and render table rows */}</tbody>
      </table>
      <button>Submit</button>
    </div>
  );
}

export default Formula;
